los costos fijos y variables a los cuales nos vamos a enfrentar son los siguientes; 
-costos fijos ( combustible, artículos de limpieza, seguro vehículo, remuneraciones)
-costos variables ( insumos propios de limpieza de acuerdo a demanda como , artículos de limpieza, desengrasantes, aromatizantes, paños, escobillas , pulverizadores, microfibras etc.)

existen dos tipos;
los fijos: (salarios ,rentas , instalación o fabricación, servicios básicos
los variables: ( varían sobre el volumen de servicios que se entregan producidos

costos fijos: arriendo de espacio de producción; arriendo de local comercial, futuro; sueldos;
contratación de servicios de marketing, contratación de servicios de distribución.
costos variables: compra de materias primas e insumos (items metálicos, aplicaciones, telas, cueros, hilos, tintas de impresión textil y normal); prendas de mezclilla para intervención, luz, agua, gas, teléfono.
